<?php

/** @var \Illuminate\Database\Eloquent\Factory $factory */

use App\Marca;
use App\Producto;
use Faker\Generator as Faker;

/*
|--------------------------------------------------------------------------
| Model Factories
|--------------------------------------------------------------------------
|
| This directory should contain each of the model factory definitions for
| your application. Factories provide a convenient way to generate new
| model instances for testing / seeding your application's database.
|
 */
$factory->define(Marca::class, function (Faker $faker) {
	return [
		'nombre' => $faker->word,
	];
});
$factory->define(Producto::class, function (Faker $faker) {
	return [
		'nombre' => $faker->word,
		'descripcion' => $faker->words(8, true),
		'precio' => $faker->randomNumber(5),
		'imagen' => "')",
		'cantidad' => $faker->randomDigitNotNull,
		'marca_id' => $faker->randomDigitNotNull,
		'categoria_id' => $faker->randomDigitNotNull,
	];
});
